Today we remember - @Aaliyah, the “Princess of R&B”. 

@Aaliyah was never afraid to celebrate her individual style, to be different and lead the way. As unique as her musical approach, her style was just as distinct. She was tomboyish, yet feminine, breaking boundaries with influential looks. Her unique approach to dressing shaped the future of streetstyle, leaving a lasting legacy on Tommy Hilfiger’s women’s line. 

While her time with us was short, Aaliyah’s influence is everywhere. She will always be remembered as an inspiration to many and a friend of #TommyHilfiger forever. ❤️
